import Header from "./header/Header";
import Footer from "./footer/Footer";
const KakaoOpenChatPage = (props) => {
	return (
		<>
			<Helmet>
				<title>gloing | {props.pageName}</title>
			</Helmet>
			<Header />
			<div className="content">{props.children}</div>
			<Footer />
		</>
	);
};

export default Layout;
